import React from "react";
import "./App.css";

function App() {
  return (
    <div className="app">
      {/* Navbar */}
      <nav className="navbar">
        <h1>Offy.AI</h1>
      </nav>

      {/* Main Content */}
      <main className="main">
        <div className="logo-container">
          {/* Logo */}
          <div className="logo">O</div>

          {/* Slogan */}
          <h2 className="slogan">Bringing AI to Everyone, Everywhere.</h2>
        </div>
      </main>
    </div>
  );
}

export default App;
